import React from "react";
import RowControl from "./RowControl";

class Table extends React.Component {
  state = { keys: [], values: [] };

  generateKeyLists = () => {
    this.setState({ keys: ["Name", "Quantity", "Price"] });
  };

  generateValueLists = () => {
    this.setState({ values: ["Apple", "102", "$1.13"] });
  };

  renderLists = () => {
    return (
      <div>
        <td data-label="Key">
          this.state.keys.map({() => console.log("keys")});
        </td>
        <td data-label="Value">
          this.state.values.map({() => console.log("values")})
        </td>
      </div>
    );
  };

  render() {
    return (
      <table className="ui celled table">
        <thead>
          <tr>
            <th className="seven wide">Key</th>
            <th className="seven wide">Value</th>
            <th className="two wide">Controls</th>
          </tr>
        </thead>

        <tbody>
          {renderLists()}
          <tr>
            <td data-label="Controls">
              <RowControl />
            </td>
          </tr>
        </tbody>
      </table>
    );
  }
}

export default Table;
